import React from 'react';
import './App.css';
import Login from './components/Login';
import Registration from './components/Registration';


function App() {
  return (
    <div>
      <header>
        <div className="container">
        <div class="col-6 col-md-4">
            <img className="facebookLogo float-left" src="https://i.ya-webdesign.com/images/facebook-white-logo-png-3.png" alt="Facebook Logo"/></div>
            <div class="col-6 col-md-4"> <Login /></div>
            <div class="col-6 col-md-4">.col-6 .col-md-4</div>
            <div class="col-md-8">
           </div>
        </div>



      </header>
      <main>
        <div className="leftPage">
          <p className="">
            Facebook membantu Anda terhubung dan berbagi dengan orang-orang dalam kehidupan Anda.
            </p>
            <img className="worldMap" src="https://static.xx.fbcdn.net/rsrc.php/v3/yi/r/OBaVg52wtTZ.png" alt="World Map"/>

        </div>
        <div className="rigthPage">
        <Registration />
        </div>

      </main>
    </div>
  );
}

export default App;
